import React from "react";


function Portfolio() {
	return (
		<main>
			<h2 className="portfolio">Project Portfolio</h2>
			<ul>
				<li>World Cookbook Project: https://atlas-chef-cookbook.herokuapp.com/</li>
				
			</ul>
			
		</main>
	);
}

export default Portfolio;
